import { Data, Params } from 'src/request/entity.d';
import { post, get, upload } from "src/request/api"

// 查询限时任务列表
export const timingTasks = (data: Data) => {
 return get('/api/v1/app/timing/query-timing-tasks', data)
}
// 查询限时任务详情
export const taskDetail = (data: Data) => {
 return get('/api/v1/app/timing/task-detail', data)
}
// 上传图片
export const uploadImg = (data: any) => {
 return upload('/index/redlists/file/upload', data)
}
